import { useState } from "react"
function RatingSelect() {
    const [selected, setSelected] = useState(10);
    const handleChange = (e) => {};
    return (
       <ul>
            <li>
                <input 
                type="radio"
                id="num1"
                name="rating"
                value='1'
                onChange={handleChange}
                checked={selected === 1}

                />
            </li>
            <li>
                <input 
                type="radio"
                id="num2"
                name="rating"
                value='2'
                onChange={handleChange}
                checked={selected === 2}

                />
            </li>
            <li>
                <input 
                type="radio"
                id="num3"
                name="rating"
                value='3'
                onChange={handleChange}
                checked={selected === 3}

                />
            </li>
       </ul> 
    )
}

export default RatingSelect
